You can update the Screen table to set the mapping to the VNext application: 

{code:sql} 
update screen set file_path='mvc/#/', file_name='InstrumentSearch_OR' where screen_id=262 
{code} 

But when the Instruments Search button is selected, the classic application redirects to SterilizerLoad.asp page. 

The other issue is that the permissions for the instrument search is tied to the "InstrumentSearch_OR" page id. The route currently in the VNext application is /instrument/search, so either the route needs to be changed in VNext or whatever modifications to the instrument search API need to be made to allow the VNext page to access the API.

