||Author||Message|| 
|Seamus|@PatrickBurrows and @BryantBrabson, regarding the query for HL_Messages on containers.asp: 
It is building a client side list of all the container messages. When the user clicks "Clear Alerts", if there is more than one alert for that container, 
the user must select which alert to clear. The messages are displayed in a list, and the user clicks on a message to clear it.| 
|Seamus|From puClearAlerts: 
{code:JavaScript} 
if(msg.length>1){ 
var message_ids=new Array(); 
var messages=new Array(); 

for(var i=0;i<msg.length;i++){ 
var m = msg[i].split('<TD>'); 
message_ids[i]=m[0]; 
messages[i]=m[1] + '\t' + m[2]; 
} 

DisplaySelectEx("Select","","","","",messages,5, "CloseMessageList('" + set_id +"')","OK"); 
} 
{code} 
"msg" is an array of all the alerts for a specific container. 
"DisplaySelectEx" displays a list in a dialog window.|

As a user I want to be notified that certain items are not scan targets on the maintenance page. 

+Acceptance Criteria+ 
* If I scan an item that hasn't been sent to maintenance then [I am notified|^notMarkedForMaintenance.png]. 
* If I scan an item that can't be sent to maintenance then [I am notified|^invalidActivityType.png]. 

\\ 
\\ 

{panel:title=(i) Notes} 
Scanning JavaScript: 
{code:javascript} 
function scanner_scannedID(scanCode){ 
var id=Array(); 
var t=scanType(scanCode,id); 
var qty=(id.length>1)?id[1]:'1'; 
var subtype=(id.length>2)?id[2]:''; 
id=id[0]; 
thisForm.scanCode.value=scanCode; 

if(t=='unknown'){ 
AlertUser('Invalid scan, unknown scan type'); 
return; 
} 
if(t=='set_id'){ 
//check for case cart 
if(scanCode.substring(0,1)=='S'){ 
AlertUser('Invalid scan type. Only instrument, container, and equipment scans are supported by this function.'); 
return; 
} 
if(thisForm.ActionType.value=='0'){ 
AlertUser('Invalid Activity Type. Containers do not use the Approve/Deny Requests process.'); 
return; 
} 
} 
else if((t!='item_mark' && t!=='equipment_id') || (subtype=='peelpack')){ 
AlertUser('Invalid scan type. Only instrument, container, and equipment scans are supported by this function.'); 
return; 
} 
if(thisForm.ActionType.value!='0'){ 
thisForm.ItemID.selectedIndex=0; 
if(thisForm_onsubmit())thisForm.submit() 
return 
} 

var x,found; 

found=0; 
window.parent.focus(); 

if(typeof(thisForm.ItemID.options)=='object'){ 
var opts=thisForm.ItemID.options 
var n=opts.length 
for(x=0;x<n;x++){ 
if(id==opts[x].value){ 
thisForm.ItemID.selectedIndex=x; 
found=1; 
break; 
} 
} 
} 
if(found==0){ 
AlertUser("This item is not marked for maintenance."); 
} else { 
thisForm.submit() 
} 
} 
{code} 
