As a technician I want to know in which containers an instrument is used. 

+Acceptance Criteria+ 
* If the instrument that I am viewing is part of a container definition then I will see a [list of container or set names|^whereUsed.png]. 
* If the instrument is not part of a container definition then I will be informed that "[t]here are no containers defined that directly require this instrument." 
* Printing. Of course I can print a list of where an instrument is used. 

\\ 
\\ 
{panel:title=(i) Notes} 
* ItemInfo.asp ~ line 339 is where the relevant SQL logic begins. It will look similar to this: 
{code:sql} 
SELECT HL_SetItem.set_id, set_name, set_hierarchy FROM HL_SetItem INNER JOIN HL_Set ON HL_SetItem.set_id = HL_Set.set_id WHERE product_id = 28317 AND set_type = 'D' GROUP BY HL_SetItem.set_id, set_name, set_hierarchy 
{code} 

{panel}

Proposed endpoint: 
{code} 
[HttpGet] 
[Route("search")] 
[CensitracAuthorization(CensitracPageNames.InstrumentSearch)] 
async Task<PagedAssemblage<IEnumerable<InstrumentViewModel>>> FindInstruments([FromUri] InstrumentSearchOptions searchOptions) 
{code} 

*{{InstrumentSearchOptions}}*: Represents the various search options available to the user. 

{code} 
public class InstrumentSearchOptions 
{ 
public string SearchValue { get; set; } //Value entered in the search box. Null if user scans an instrument. 

public string ItemMark { get; set; } //Value of the instrument scan. Null if no item scanned. 

public bool IncludeSubstitutes { get; set; } 

public InstrumentSearchSortOptions Sort { get; set; } //Enum. See values below. 

public bool ShowItemsCurrentlyAssembledIntoContainers { get; set; } 

public bool? SearchAllFacilities { get; set; } //Null if this option is not available to the user. 

public int Page { get; set; } //Which page of data to fetch. 

public int PageSize { get; set; } //How many items should be in each page of data. 
} 
{code} 

{code} 
