ByLastScannedDate = 3 
} 
{code} 

For the output, I will add *{{(ProductViewModel)Product}}*, and *{{(string)FacilityName}}* to *{{InstrumentViewModel}}*: 

{code} 
public class InstrumentViewModel 
{ 
public int Id { get; set; } 

public ProductViewModel Product { get; set; } //NEW 

public string UpdateUserId { get; set; } 

public DateTime UpdateTimestamp { get; set; } 

public string Status { get; set; } 

public string FacilityName { get; set; } //NEW 

public string LocationName { get; set; } 

public string ContainerName { get; set; } 
} 
{code} 

And I will add *{{(string)Alias}}* to *{{ProductViewModel}}*: 

{code} 
public class ProductViewModel 
{ 
public decimal Id { get; set; } 

public string VendorName { get; set; } 

public string VendorProductName { get; set; } 

public string Alias { get; set; } //NEW 

public string ModelNumber { get; set; } 

public string GraphicKey { get; set; } 

public int VendorId { get; set; } 

public bool IsGlobalProduct { get; set; } 

public bool LeakTestRequired { get; set; } 

public bool IsGeneric => VendorId == GenericCatalogOption.VendorId; 

public string Description => IsGeneric 
? $"{VendorProductName} ({GenericCatalogOption.VendorName})" 
: $"{VendorProductName} ({VendorName} {ModelNumber})"; 
} 
{code} 

So the output columns for the user will be as follows: 

*Facility:* {{InstrumentViewModel.FacilityName}} 
*Supplier:* {{InstrumentViewModel.Product.VendorName}} 
*Cat. No.:* {{InstrumentViewModel.Product.ModelNumber}} 
*Product Name (Alias):* {{InstrumentViewModel.Product.VendorProductName}} and {{InstrumentViewModel.Product.Alias}} 
*Container:* {{InstrumentViewModel.ContainerName}} 
*Location:* {{InstrumentViewModel.LocationName}} 
*TimeStamp:* {{InstrumentViewModel.UpdateTimestamp}} 

*NOTE:* The facility search option and the facility output column are only visible if the customer has more than one active facility.

