HL_Equipment table has a field "container_flag" which is a Char(1) marked as NOT NULL. All the records in the DB I am using have that field set as "N". 
The add_equipment stored procedure doesn't insert or update this field. No trigger inserts or updates it, and I don't find that field referenced in any of the .asp pages that have anything to do with equipment (the references to a field with that name seem to be in Product pages) 
Is it safe to just set this field to "N"? 
{noformat} 


{code:SQL} 
SELECT COUNT(*) FROM HL_Equipment WHERE container_flag <> 'N' 
{code} 
across all customer databases returns 0 so it appears that this column is no longer used. Results attached.
